    false,nt"url": null,nt"notes": "This report covers the prey utilization
    by wolves and an assessment of wolf and prey densities in 3 drainages within the
    Arctic National Wildlife Refuge. The relative utilization and availability of prey
    types used by wolves (Canis lupus) in the Kongakut, Hulahula and Canning River drainages
    was assessed by visual observation and by analysis of wolf scats. Wolves were observed
    in each of the 3 drainages. Visual assessment indicated that moose (Aloes aloes),
    caribou (Rangifer tarandus), and Dall sheep (Ovis dalli) were available to the wolves
    in the Kongakut drainage. In the Hulahula drainage, sheep seemed to be the prey
    species most available, while in the Canning moose were present in relatively high
    densities and caribou at a lower but stable density. Scat analysis indicated that
    the Kongakut wolves preyed on the 3 available ungulates, but focused on caribou;
    the Hulahula wolves also utilized all 3 species, but ate relatively more sheep;
    while no moose remains were found in the scats from the Canning.",nt"owner_org":
